import React, { Component } from 'react';


class Footer extends Component {


    render() { 
        var footerStyle = {
            position: 'fixed',
            width: '100%',
            textAlign: 'center',
            justifyContent: 'center',
            height: '10rem',
            marginBottom: '0',         
        }

        return (
        <div style={footerStyle}>
            <p>footer</p>
        </div>
            );
    }
}
 
export default Footer;
